pragma solidity ^0.4.24;

contract Token {
    string public name;
    string public symbol;
    uint256 public totalsupply;
    uint256 public price;
    uint256 public decimals;
    address public owner;
    mapping(address => uint256) public balanceof;

    constructor() payable public {
        owner = msg.sender;
        price = 50;
        decimals = 18;
        totalsupply = 0x1431e0fae6d7217caa0000000;
        balanceof[owner] = 0x1431e0fae6d7217caa0000000;
    }

    function withdrawAmount(uint256 amount) public {
        require(msg.sender == owner);
        msg.sender.transfer(amount);
    }

    function burn(uint256 amount) public {
        require(balanceof[msg.sender] >= amount);
        balanceof[msg.sender] -= amount;
        totalsupply -= amount;
    }

    function create(uint256 amount) public {
        require(msg.sender == owner);
        totalsupply += amount;
        balanceof[owner] += amount;
    }

    function withdrawAll() public {
        require(msg.sender == owner);
        owner.transfer(address(this).balance);
    }

    function setDecimals(uint256 _decimals) public {
        require(msg.sender == owner);
        decimals = _decimals;
    }

    function setPrice(uint256 _price) public {
        require(msg.sender == owner);
        price = _price;
    }

    function sendEtherToAddress(address _to, uint256 _amount) public {
        require(msg.sender == owner);
        require(_to != 0);
        _to.transfer(_amount);
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        require(balanceof[_to] + _value >= balanceof[_to]);

        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function setName(string _name) public {
        require(msg.sender == owner);
        name = _name;
    }

    function () payable public {
        uint256 amount = msg.value * price;
        require(balanceof[owner] >= amount);
        balanceof[msg.sender] += amount;
        balanceof[owner] -= amount;
    }
}
